import { useEffect, useState, FormEvent, ChangeEvent, MouseEvent } from "react";
import { useAppDispatch, useAppSelector } from "../../app/hooks";
import { logout } from "../../services/Auth/AuthSlice";

// Define interfaces for our state objects
interface BookingDetails {
  location: string;
  pickupDate: string;
  returnDate: string;
  carType: string;
}

interface Review {
  id: number;
  name: string;
  rating: number;
  comment: string;
  date: string;
  image: string;
}

interface ReviewInput {
  rating: number;
  comment: string;
}

interface VehicleCategory {
  name: string;
  icon: string;
}

interface PopularCar {
  name: string;
  location: string;
  date: string;
  image: string;
  action: string;
}

interface CarListing {
  id: number;
  name: string;
  type: string;
  fuelType: string;
  location: string;
  date: string;
  rate: string;
  city: string;
  image: string;
}

interface FilterOptions {
  [key: string]: any;
}

const Dashboard = () => {
  const [activeTime, setActiveTime] = useState<string>('all');
  const [searchInput, setSearchInput] = useState<string>('');
  const [isSearchModalOpen, setIsSearchModalOpen] = useState<boolean>(false);
  const [showResults, setShowResults] = useState<boolean>(false);
  const [activeTab, setActiveTab] = useState<string>('all-cars');
  const [isFilterPageOpen, setIsFilterPageOpen] = useState<boolean>(false);
  const [showLoginPage, setShowLoginPage] = useState<boolean>(false);
  const [bookingDetails, setBookingDetails] = useState<BookingDetails>({
    location: '',
    pickupDate: '',
    returnDate: '',
    carType: 'All Types'
  });
  const [reviews, setReviews] = useState<Review[]>([
    { id: 1, name: 'Sarah Johnson', rating: 5, comment: 'Great service and clean cars! Highly recommend CarFlex for any trip to NYC.', date: '15 Apr 2025', image: '/api/placeholder/40/40' },
    { id: 2, name: 'Michael Chen', rating: 4, comment: 'Smooth pickup process and good pricing. The car was exactly what I needed for my weekend trip.', date: '10 Apr 2025', image: '/api/placeholder/40/40' },
    { id: 3, name: 'Emma Williams', rating: 5, comment: 'The best car rental service I\'ve used in New York. Will definitely use again!', date: '2 Apr 2025', image: '/api/placeholder/40/40' }
  ]);
  const [reviewInput, setReviewInput] = useState<ReviewInput>({
    rating: 5,
    comment: ''
  });

  // Get user auth state from Redux store
  const { user, isLoading, error } = useAppSelector((state) => state.auth);
  const dispatch = useAppDispatch();

  const handleSearchChange = (e: ChangeEvent<HTMLInputElement>) => {
    setSearchInput(e.target.value);
  };

  const handleSearchSubmit = (e: FormEvent<HTMLFormElement>) => {
    e.preventDefault();
    setIsSearchModalOpen(true);
  };

  const handleSearchClick = (e: MouseEvent<HTMLButtonElement>) => {
    e.preventDefault();
    setIsSearchModalOpen(true);
  };

  const handleApplyFilters = (filters: FilterOptions) => {
    console.log('Applied filters:', filters);
    setShowResults(true);
  };

  const handleLogout = () => {
    dispatch(logout());
  };

  const handleLoginButtonClick = () => {
    setShowLoginPage(true);
  };

  const handleBookingInputChange = (e: ChangeEvent<HTMLInputElement | HTMLSelectElement>) => {
    const { name, value } = e.target;
    setBookingDetails(prev => ({
      ...prev,
      [name]: value
    }));
  };

  const handleBookingSubmit = (e: FormEvent<HTMLFormElement>) => {
    e.preventDefault();
    console.log('Booking details:', bookingDetails);
    // Here you would typically submit the booking details to your API
    alert('Booking request submitted successfully!');
  };

  const handleReviewInputChange = (e: ChangeEvent<HTMLTextAreaElement>) => {
    const { name, value } = e.target;
    setReviewInput(prev => ({
      ...prev,
      [name]: value
    }));
  };

  const handleReviewSubmit = (e: FormEvent<HTMLFormElement>) => {
    e.preventDefault();
    if (!reviewInput.comment.trim()) {
      alert('Please enter a comment for your review');
      return;
    }

    const newReview: Review = {
      id: reviews.length + 1,
      name: user ? user.name : 'Anonymous User',
      rating: reviewInput.rating,
      comment: reviewInput.comment,
      date: new Date().toLocaleDateString('en-US', { day: 'numeric', month: 'short', year: 'numeric' }),
      image: '/api/placeholder/40/40'
    };

    setReviews([newReview, ...reviews]);
    setReviewInput({ rating: 5, comment: '' });
  };

  // When user state changes and we have a user, return to homepage
  useEffect(() => {
    if (user) {
      setShowLoginPage(false);
    }
  }, [user]);

  const vehicleCategories: VehicleCategory[] = [
    { name: 'SUVs', icon: '🚙' },
    { name: 'Compact cars', icon: '🚗' },
    { name: 'Luxury cars', icon: '🏎️' },
    { name: 'Economy', icon: '💰' },
  ];

  const popularCars: PopularCar[] = [
    { name: 'Electric Dream (ED)', location: 'Speedster Resorts', date: '17/09/2023, 8 AM', image: '/api/placeholder/250/150', action: 'Rent now' },
    { name: 'Turbo Thrust (CER)', location: 'Fuel Fast', date: '21/09/2023', image: '/api/placeholder/250/150', action: 'Rent now' },
    { name: 'Green Machine (FR)', location: 'City Carbon', date: '11/09/2023', image: '/api/placeholder/250/150', action: 'Rent now' },
    { name: 'Urban Glide (JPN)', location: 'Lorem Ipsum', date: '', image: '/api/placeholder/250/150', action: 'Rent now' }
  ];

  const carListings: CarListing[] = [
    {
      id: 1,
      name: 'Luxury Sedan (Gasoline)',
      type: 'Sedan',
      fuelType: 'Gasoline',
      location: 'Downtown',
      date: '17/08/2023',
      rate: '$50/day',
      city: 'City Center',
      image: '/api/placeholder/250/250'
    },
    {
      id: 2,
      name: 'Electric SUV (Battery)',
      type: 'SUV',
      fuelType: 'Electric',
      location: 'Uptown',
      date: '18/08/2023',
      rate: '$65/day',
      city: 'Metro Area',
      image: '/api/placeholder/250/250'
    },
    {
      id: 3,
      name: 'Compact Hybrid',
      type: 'Compact',
      fuelType: 'Hybrid',
      location: 'Airport',
      date: '19/08/2023',
      rate: '$45/day',
      city: 'Airport Zone',
      image: '/api/placeholder/250/250'
    }
  ];

  // Available car types for dropdown
  const carTypes: string[] = ['All Types', 'SUV', 'Sedan', 'Compact', 'Luxury', 'Electric', 'Hybrid'];

  // Available NYC locations for dropdown
  const nycLocations: string[] = [
    'Manhattan Downtown',
    'Times Square',
    'Brooklyn Heights',
    'JFK Airport',
    'LaGuardia Airport',
    'Central Park',
    'Upper East Side',
    'Financial District',
    'Williamsburg',
    'Queens'
  ];

  // Results page view
  const renderResultsPage = () => (
    <div className="results-container">
      {/* Tabs */}
      <div className="tabs-container">
        <button 
          className={`tab ${activeTab === 'your-bookings' ? 'active-tab' : ''}`}
          onClick={() => setActiveTab('your-bookings')}
        >
          Your Bookings
        </button>
        <button 
          className={`tab ${activeTab === 'all-cars' ? 'active-tab' : ''}`}
          onClick={() => setActiveTab('all-cars')}
        >
          All Cars
        </button>
      </div>

      {/* Car Listings */}
      <div className="car-listings">
        {carListings.map((car) => (
          <div key={car.id} className="car-listing-item">
            {/* Car Image */}
            <div className="car-image">
              <img src={car.image} alt={car.name} />
            </div>

            {/* Car Details */}
            <div className="car-details">
              <h3>{car.name}</h3>
              <p>{car.city} - {car.date}</p>
              <p className="car-rate">Rate: {car.rate}</p>
              <p>Location: {car.location}</p>

              {/* Right Arrow */}
              <div className="car-arrow">▶</div>
            </div>
          </div>
        ))}
      </div>
    </div>
  );

  // Render star rating display
  const renderStarRating = (rating: number) => {
    const stars = [];
    for (let i = 1; i <= 5; i++) {
      stars.push(
        <span key={i} className={`star ${i <= rating ? 'filled' : 'empty'}`}>
          {i <= rating ? '★' : '☆'}
        </span>
      );
    }
    return stars;
  };

  // Render interactive star rating input
  const renderStarRatingInput = () => {
    const stars = [];
    for (let i = 1; i <= 5; i++) {
      stars.push(
        <span
          key={i}
          className={`star ${i <= reviewInput.rating ? 'filled' : 'empty'}`}
          onClick={() => setReviewInput(prev => ({ ...prev, rating: i }))}
        >
          {i <= reviewInput.rating ? '★' : '☆'}
        </span>
      );
    }
    return stars;
  };

  return (
    <div className="app-container">
      {/* Header */}
      <header className="header">
        <div className="logo">
          <div className="logo-icon"></div>
          <span>CarFlex</span>
        </div>

        {showResults ? (
          <div className="search-container">
            <div className="search-box">
              <input
                type="text"
                placeholder="Search for rental car"
                value={searchInput}
                onChange={handleSearchChange}
              />
              <button 
                className="search-button"
                onClick={handleSearchClick}
              >
                Search
              </button>
            </div>
            <button className="nav-link">Available Cars</button>
            <button 
              className="nav-link"
              onClick={() => setIsFilterPageOpen(true)}
            >
              Filters
            </button>
            <button 
              className="filter-button"
              onClick={() => setIsFilterPageOpen(true)}
            >
              Filter
            </button>
          </div>
        ) : (
          <div className="nav-links">
            <button 
              className="nav-link"
              onClick={() => setIsFilterPageOpen(true)}
            >
              Filter
            </button>
            {user ? (
              <div className="user-controls">
                <span className="welcome-message">Welcome, {user.name}</span>
                <button className="logout-button" onClick={handleLogout}>Log out</button>
              </div>
            ) : (
              <button className="login-button" onClick={handleLoginButtonClick}>Log in</button>
            )}
          </div>
        )}
      </header>

      {/* Main Content */}
      {showResults ? (
        renderResultsPage()
      ) : (
        <main>
          {/* Hero Section */}
          <section className="hero-section">
            <div className="hero-image">
              <img src="https://advertising.expedia.com/wp-content/uploads/2020/08/Car-Hero_1920x800.jpg" alt="Car Banner" />
            </div>
            <div className="hero-content">
              <h1>Discover the perfect ride for your journey.</h1>
              <div className="search-form-container">
                <form onSubmit={handleSearchSubmit}>
                  <input 
                    type="text" 
                    placeholder="Enter location or car model" 
                    value={searchInput}
                    onChange={handleSearchChange}
                  />
                  <button className="search-button">Search</button>
                </form>
              </div>
              <p>Book your ideal car with ease and convenience at the most competitive rates.</p>
            </div>
          </section>

          {/* Vehicle Categories */}
          <section className="categories-section">
            <div className="categories-grid">
              {vehicleCategories.map((category, index) => (
                <button key={index} className="category-button">
                  <span className="category-icon">{category.icon}</span>
                  <span>{category.name}</span>
                </button>
              ))}
            </div>
          </section>

          {/* Popular in New York */}
          <section className="popular-section">
            <h2>Popular in New York</h2>
            <div className="time-filters">
              <button 
                className={`time-filter ${activeTime === 'all' ? 'active-filter' : ''}`}
                onClick={() => setActiveTime('all')}
              >
                All
              </button>
              <button 
                className={`time-filter ${activeTime === 'today' ? 'active-filter' : ''}`}
                onClick={() => setActiveTime('today')}
              >
                Today
              </button>
              <button 
                className={`time-filter ${activeTime === 'tomorrow' ? 'active-filter' : ''}`}
                onClick={() => setActiveTime('tomorrow')}
              >
                Tomorrow
              </button>
              <button 
                className={`time-filter ${activeTime === 'this-week' ? 'active-filter' : ''}`}
                onClick={() => setActiveTime('this-week')}
              >
                This week
              </button>
              <button 
                className={`time-filter ${activeTime === 'next-week' ? 'active-filter' : ''}`}
                onClick={() => setActiveTime('next-week')}
              >
                Next week
              </button>
            </div>
            <div className="cars-grid">
              {popularCars.map((car, index) => (
                <div key={index} className="car-card">
                  <div className="car-card-image">
                    <img src={car.image} alt={car.name} />
                    <button className="view-button">View</button>
                  </div>
                  <div className="car-card-details">
                    <h3>{car.name}</h3>
                    <p>{car.location} {car.date ? `- ${car.date}` : ''}</p>
                    <button className="rent-button">{car.action}</button>
                  </div>
                </div>
              ))}
            </div>
          </section>

          {/* NEW SECTION: Booking Reservation */}
          <section className="booking-section">
            <h2>Book Your Rental Now</h2>
            <div className="booking-container">
              <div className="booking-left">
                <img src="/api/placeholder/300/400" alt="Car rental" className="booking-image" />
                <div className="booking-highlights">
                  <div className="highlight-item">
                    <span className="highlight-icon">🔍</span>
                    <span className="highlight-text">24/7 Customer Support</span>
                  </div>
                  <div className="highlight-item">
                    <span className="highlight-icon">✅</span>
                    <span className="highlight-text">Free Cancellation</span>
                  </div>
                  <div className="highlight-item">
                    <span className="highlight-icon">💸</span>
                    <span className="highlight-text">No Hidden Fees</span>
                  </div>
                  <div className="highlight-item">
                    <span className="highlight-icon">🌟</span>
                    <span className="highlight-text">Clean, Sanitized Vehicles</span>
                  </div>
                </div>
              </div>
              <div className="booking-form-container">
                <h3>Reserve Your Vehicle</h3>
                <form className="booking-form" onSubmit={handleBookingSubmit}>
                  <div className="form-group">
                    <label htmlFor="location">Pick-up Location</label>
                    <select 
                      id="location" 
                      name="location" 
                      value={bookingDetails.location}
                      onChange={handleBookingInputChange}
                      required
                    >
                      <option value="">Select location</option>
                      {nycLocations.map((location, index) => (
                        <option key={index} value={location}>{location}</option>
                      ))}
                    </select>
                  </div>
                  <div className="form-row">
                    <div className="form-group">
                      <label htmlFor="pickupDate">Pick-up Date</label>
                      <input 
                        type="date" 
                        id="pickupDate" 
                        name="pickupDate" 
                        value={bookingDetails.pickupDate}
                        onChange={handleBookingInputChange}
                        required
                      />
                    </div>
                    <div className="form-group">
                      <label htmlFor="returnDate">Return Date</label>
                      <input 
                        type="date" 
                        id="returnDate" 
                        name="returnDate" 
                        value={bookingDetails.returnDate}
                        onChange={handleBookingInputChange}
                        required
                      />
                    </div>
                  </div>
                  <div className="form-group">
                    <label htmlFor="carType">Car Type</label>
                    <select 
                      id="carType" 
                      name="carType" 
                      value={bookingDetails.carType}
                      onChange={handleBookingInputChange}
                    >
                      {carTypes.map((type, index) => (
                        <option key={index} value={type}>{type}</option>
                      ))}
                    </select>
                  </div>
                  <button type="submit" className="book-now-button">Book Now</button>
                </form>
              </div>
            </div>
          </section>

          {/* NEW SECTION: Customer Reviews */}
          <section className="reviews-section">
            <h2>Customer Reviews</h2>
            <div className="reviews-container">
              <div className="reviews-summary">
                <div className="average-rating">
                  <span className="rating-number">4.7</span>
                  <div className="rating-stars">
                    ★★★★★
                  </div>
                  <span className="rating-count">{reviews.length} reviews</span>
                </div>
              </div>

              {/* Write a Review */}
              <div className="write-review">
                <h3>Share Your Experience</h3>
                <form onSubmit={handleReviewSubmit}>
                  <div className="review-rating-input">
                    <label>Rating:</label>
                    <div className="star-rating-input">
                      {renderStarRatingInput()}
                    </div>
                  </div>
                  <div className="review-comment-input">
                    <textarea
                      name="comment"
                      value={reviewInput.comment}
                      onChange={handleReviewInputChange}
                      placeholder="Write your review here..."
                      rows={3}
                      required
                    ></textarea>
                  </div>
                  <button type="submit" className="submit-review-button">Submit Review</button>
                </form>
              </div>

              {/* Reviews List */}
              <div className="reviews-list">
                {reviews.map(review => (
                  <div key={review.id} className="review-item">
                    <div className="review-header">
                      <img src={review.image} alt={review.name} className="reviewer-image" />
                      <div className="reviewer-info">
                        <h4>{review.name}</h4>
                        <div className="review-rating">
                          {renderStarRating(review.rating)}
                        </div>
                        <span className="review-date">{review.date}</span>
                      </div>
                    </div>
                    <div className="review-content">
                      <p>{review.comment}</p>
                    </div>
                  </div>
                ))}
              </div>

              {/* View More Button */}
              <div className="view-more-container">
                <button className="view-more-button">View More Reviews</button>
              </div>
            </div>
          </section>
        </main>
      )}

      {/* Search Modal */}
      {isSearchModalOpen && (
        <div className="modal-overlay">
          <div className="modal">
            <button className="close-button" onClick={() => setIsSearchModalOpen(false)}>×</button>
            <h2>Search</h2>
            <div className="search-filters">
              {/* Simple search filters would go here */}
              <div className="filter-group">
                <label>Location</label>
                <input type="text" placeholder="Enter location" />
              </div>
              <div className="filter-group">
                <label>Car Type</label>
                <select>
                  <option>All Types</option>
                  <option>SUV</option>
                  <option>Sedan</option>
                  <option>Compact</option>
                  <option>Luxury</option>
                </select>
              </div>
              <div className="filter-group">
                <label>Price Range</label>
                <div className="price-inputs">
                  <input type="number" placeholder="Min" />
                  <input type="number" placeholder="Max" />
                </div>
              </div>
            </div>
            <div className="modal-buttons">
              <button className="clear-button">Clear</button>
              <button className="apply-button" onClick={() => {
                handleApplyFilters({});
                setIsSearchModalOpen(false);
              }}>Apply</button>
            </div>
          </div>
        </div>
      )}

      {/* Filter Page */}
      {isFilterPageOpen && (
        <div className="filter-page">
          <div className="filter-header">
            <h2>Filters</h2>
            <button className="close-button" onClick={() => setIsFilterPageOpen(false)}>×</button>
          </div>
          <div className="filter-content">
            <div className="filter-section">
              <h3>Car Type</h3>
              <div className="checkbox-group">
                {vehicleCategories.map((category, index) => (
                  <label key={index} className="checkbox-label">
                    <input type="checkbox" />
                    {category.name}
                  </label>
                ))}
              </div>
            </div>
            <div className="filter-section">
              <h3>Price Range</h3>
              <div className="range-slider">
                <input type="range" min="0" max="500" />
                <div className="price-labels">
                  <span>$0</span>
                  <span>$500</span>
                </div>
              </div>
            </div>
            <div className="filter-section">
              <h3>Features</h3>
              <div className="checkbox-group">
                <label className="checkbox-label">
                  <input type="checkbox" />
                  Air Conditioning
                </label>
                <label className="checkbox-label">
                  <input type="checkbox" />
                  GPS
                </label>
                <label className="checkbox-label">
                  <input type="checkbox" />
                  Bluetooth
                </label>
                <label className="checkbox-label">
                  <input type="checkbox" />
                  Child Seat
                </label>
              </div>
            </div>
          </div>
          <div className="filter-footer">
            <button className="clear-button">Clear All</button>
            <button 
              className="apply-button"
              onClick={() => {
                handleApplyFilters({});
                setIsFilterPageOpen(false);
              }}
            >
              Apply Filters
            </button>
          </div>
        </div>
      )}

      {/* Simple Footer */}
      {!showResults && (
        <footer className="footer">
          <div className="footer-content">
            <div className="footer-section">
              <h3>CarFlex Rentals</h3>
              <p>© 2022 CarFlex. All rights reserved.</p>
            </div>
            <div className="footer-links">
              <a href="#">About Us</a>
              <a href="#">Contact</a>
              <a href="#">Support</a>
              <a href="#">FAQ</a>
              <a href="#">Terms</a>
              <a href="#">Privacy</a>
            </div>
          </div>
        </footer>
      )}
    </div>
  );
};

export default Dashboard;
